import { Grid } from "@material-ui/core";
import React, { Component } from "react";
import Metric from "./Metric";

const MetricRow = () => {
  return (
    <Grid container>
      <Grid item sm={3}>
        <Metric
          title={"Total Views"}
          metric={"12"}
          variance={"+12%"}
          varianceType={"success"}
          subtitle={"Last 7 days"}
        />
      </Grid>
      <Grid item sm={3}>
        <Metric
          title={"Check Ins"}
          metric={"680"}
          variance={"-10%"}
          varianceType={"error"}
          subtitle={"Last 7 days"}
        />
      </Grid>
      <Grid item sm={3}>
        <Metric
          title={"New Connections"}
          metric={"3"}
          variance={"+1%"}
          varianceType={"error"}
          subtitle={"Last 7 days"}
        />
      </Grid>
      <Grid item sm={3}>
        <Metric
          title={"Active Buddies"}
          metric={"3"}
          variance={"+1%"}
          varianceType={"error"}
          subtitle={"Last 5 days"}
        />
      </Grid>
    </Grid>
  );
};

export default MetricRow;
